import React, { Component } from 'react'

export class HouseForm extends Component {


    state = {
        state: "",
        city: "",
        address: "",
        number_of_tenants: ""
    }


    handleChange = event => {
        this.setState({
            [event.target.name]: event.target.value
        })
    }

    handleChange = {

    }



    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit.bind(this)}>
                    <div>
                        <label htmlFor="state">State: </label>
                        <input type="text" name="state" id="state" class="form-control" onChange={this.handleChange} />
                    </div>

                    <div>
                        <label htmlFor="city">City: </label>
                        <input type="text" name="city" id="city" class="form-control" onChange={this.handleChange} />
                    </div>

                    <div>
                        <label htmlFor="address">Address: </label>
                        <input type="text" name="address" id="address" class="form-control" onChange={this.handleChange} />
                    </div>

                    <div>
                        <label htmlFor="number_of_tenants">Number of Tenants: </label>
                        <input type="text" name="number_of_tenants" id="number_of_tenants" class="form-control" onChange={this.handleChange} />
                    </div>

                    <input type="submit" value="Create House" class="btn btn-primary" />

                </form>
            </div>
        )
    }
}

export default HouseForm
